import styled from 'styled-components';

export const Wrapper = styled.footer`
  background-color: rgb(40, 40, 40);
  color: white;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
  height: 90px;
  padding: 0 16px;
  position: fixed;
  left: 0;
  bottom: 0;
  width: 100vw;
`;
